import Link from "next/link";
import React from "react";
import User from "../../components/User";

const indexAuthPage = () => {
  return (
    <div>
      <h1>The Authentication Page</h1>
      <User name="Crazybirdz" age="22" />
      <p>
        Go to{" "}
        <Link href="/">
          <a>Main</a>
        </Link>
      </p>
    </div>
  );
};

export default indexAuthPage;
